import numpy as np
import pandas as pd
import torch
from torch import nn
import torch.nn.functional as F

class ExpertFeedForward(nn.Module):
    def __init__(self, d_model, d_ff):
        super().__init__()
        self.fc1 = nn.Linear(d_model, d_ff)
        self.fc2 = nn.Linear(d_ff, d_model)

    def forward(self, x):
        return self.fc2(F.gelu(self.fc1(x)))

class MoE(nn.Module):
    def __init__(self, d_model, d_ff, n_experts=8, k=2):
        super().__init__()
        self.d_model = d_model
        self.n_experts = n_experts
        self.k = k
        self.experts = nn.ModuleList([ExpertFeedForward(d_model, d_ff) for _ in range(n_experts)])
        self.router = nn.Linear(d_model, n_experts)

    def forward(self, x):
        B, L, D = x.shape
        x_flat = x.view(-1, D)
        logits = self.router(x_flat)
        probs = F.softmax(logits, dim=-1)
        top_weights, top_indices = probs.topk(self.k, dim=-1)

        contributions = []
        for i, expert in enumerate(self.experts):
            mask = (top_indices == i).any(dim=-1)
            if mask.any():
                inp = x_flat[mask].clone()  # clone to avoid in-place
                weight = (top_weights * (top_indices == i).float()).sum(dim=-1)
                weight = weight[mask].unsqueeze(-1)
                expert_out = expert(inp * weight)
                full_out = torch.zeros_like(x_flat)
                full_out[mask] = expert_out
                contributions.append(full_out)

        output_flat = sum(contributions) if contributions else torch.zeros_like(x_flat)

        importance = probs.sum(dim=0)
        imp = importance / x_flat.size(0)
        lb_loss = (self.n_experts * (imp * imp).sum()).unsqueeze(0)

        return output_flat.view(B, L, D), lb_loss

class HardAttention_MHA(torch.nn.Module):
  def __init__(self, d_model, n_heads, top_k_tokens=1):
    super().__init__()

    self.d_model = d_model
    self.n_heads = n_heads
    self.top_k_tokens = top_k_tokens
    self.d_k = d_model // n_heads

    self.q_proj = nn.Linear(d_model, d_model)
    self.k_proj = nn.Linear(d_model, d_model)
    self.v_proj = nn.Linear(d_model, d_model)
    self.o_proj = nn.Linear(d_model, d_model)

  def split_heads(self, x):

    B, L, D = x.shape
    return x.view(B, L, self.n_heads, self.d_k).transpose(1, 2)

  def combine_heads(self, x):

    B, H, L, d_k = x.shape
    return x.transpose(1, 2).contiguous().view(B, L, self.d_model)

  def hard_policy(self, Q, K, V, causal_mask):

    B, H, L_q, D_k = Q.shape
    L_k = K.shape[2]

    scores = torch.matmul(Q, K.transpose(-2, -1)) / torch.sqrt(torch.tensor(D_k, dtype=torch.float32, device=Q.device))
    scores = scores.masked_fill(causal_mask == 0, float('-inf'))

    policy_probs = F.softmax(scores, dim=-1)
    flat_probs = policy_probs.view(-1, L_k)
    policy_indices = torch.multinomial(flat_probs, self.top_k_tokens, replacement=False)
    sampled_indices = policy_indices.view(B, H, L_q, self.top_k_tokens)

    hard_mask = torch.zeros_like(scores).scatter(-1, sampled_indices, True)
    hard_weights = hard_mask.float()
    hard_output = torch.matmul(hard_weights, V)

    log_policy = F.log_softmax(scores, dim=-1)
    log_probs_sampled = torch.gather(log_policy, -1, sampled_indices)
    log_prob_action = log_probs_sampled.sum(dim=-1)

    return hard_output, log_prob_action

  def forward(self, x, causal_mask):
    Q = self.split_heads(self.q_proj(x))
    K = self.split_heads(self.k_proj(x))
    V = self.split_heads(self.v_proj(x))


    attn_out, log_prob = self.hard_policy(Q, K, V, causal_mask)
    attn_out = self.combine_heads(attn_out)
    # Ensure log_prob is returned here
    return self.o_proj(attn_out), log_prob

class Transformer_Block(nn.Module):
    def __init__(self, d_model, d_ff, n_heads, top_k_tokens, n_experts=8, k_moe=2):
        super().__init__()
        self.attention = HardAttention_MHA(d_model, n_heads, top_k_tokens)
        self.moe = MoE(d_model, d_ff, n_experts, k_moe)
        self.layer_norm_1 = nn.LayerNorm(d_model)
        self.layer_norm_2 = nn.LayerNorm(d_model)

    def forward(self, x, causal_mask):
        # Attention
        norm_x = self.layer_norm_1(x)
        attn_out, log_prob = self.attention(norm_x, causal_mask)
        x = x + attn_out.clone()  # clone to avoid in-place issues

        # MoE
        norm_x2 = self.layer_norm_2(x)
        moe_out, lb_loss = self.moe(norm_x2)
        x = x + moe_out.clone()  # clone to avoid in-place issues

        return x, log_prob, lb_loss

class Decoder_LLM(nn.Module):
    def __init__(self, vocab_size, d_model, max_seq_len,
                 n_layers, d_ff, n_heads=8, top_k_tokens=2, n_experts=8, k_moe=2):
        super().__init__()
        self.token_embed = nn.Embedding(vocab_size, d_model)
        self.pos_embed = nn.Embedding(max_seq_len, d_model)

        self.layers = nn.ModuleList([
            Transformer_Block(d_model, d_ff, n_heads, top_k_tokens, n_experts, k_moe) for _ in range(n_layers)
        ])
        self.final_norm = nn.LayerNorm(d_model)
        self.output_head = nn.Linear(d_model, vocab_size, bias=False)

    def forward(self, input_ids, return_log_probs=False):
        B, L = input_ids.shape
        x = self.token_embed(input_ids)
        positions = torch.arange(L, device=input_ids.device).unsqueeze(0)
        x = x + self.pos_embed(positions)

        x = x.clone()
        causal_mask = torch.tril(torch.ones(L, L, device=input_ids.device)).bool()

        all_log_prob = []
        total_lb_loss = 0

        for layer in self.layers:
            x, log_prob, lb_loss = layer(x, causal_mask)
            all_log_prob.append(log_prob)
            total_lb_loss += lb_loss

        x = self.final_norm(x)
        logits = self.output_head(x)

        if return_log_probs:
            return logits, all_log_prob, total_lb_loss

        return logits

def Hybrid_training(model, batch, rl_optim, lm_optim, lb_loss_weight):
    input_ids, labels = batch

    # 1. Forward Pass under autocast
    logits, log_probs, total_lb_loss = model(input_ids, return_log_probs=True)

    lm_loss = F.cross_entropy(logits.view(-1, logits.size(-1)), labels.view(-1))
    total_lm_loss = lm_loss + (lb_loss_weight * total_lb_loss)

        # --- Calculate RL Loss ---
    reward = -lm_loss.detach() # Keep detached
    rl_loss = 0
    for lp in log_probs:
      flat_lp = lp.view(-1)
      rl_loss += -(reward.expand_as(flat_lp) * flat_lp).mean()

    # --- 2. Backward Passes: Use Scaler ---

    # Zero gradients for both optimizers
    lm_optim.zero_grad()
    rl_optim.zero_grad()


    total_lm_loss.backward(retain_graph=True)


    rl_loss.backward()


    lm_optim.step()
    rl_optim.step()

    return total_lm_loss.item(), rl_loss.item(), total_lb_loss.item()

from datasets import load_dataset
dataset = load_dataset("wikitext", "wikitext-2-raw-v1")

from transformers import GPT2TokenizerFast

tokenizer = GPT2TokenizerFast.from_pretrained('gpt2')
tokenizer.pad_token = tokenizer.eos_token

VOCAB_SIZ = tokenizer.vocab_size
D_MODEL = 256
D_FF = 1024
N_HEADS = 4
N_LAYERS = 6
MAX_SEQ_LEN = 128
K_TOP_TOKENS = 2
N_EXPERTS = 6
K_MOE = 2

BATCH_SIZE = 32
LEARNING_RATE_LM = 1e-4
LEARNING_RATE_RL = 5e-5
LB_LOSS_WEIGHT = 0.01  # Lambda_2 from the paper
NUM_EPOCHS = 10

Model = Decoder_LLM(vocab_size=VOCAB_SIZ, d_model=D_MODEL, d_ff=D_FF, n_heads=N_HEADS, n_layers=N_LAYERS,
                    n_experts=N_EXPERTS, top_k_tokens=K_TOP_TOKENS, k_moe=K_MOE, max_seq_len=MAX_SEQ_LEN)

lm_optim = torch.optim.Adam(Model.parameters(), lr=LEARNING_RATE_LM)
rl_optim = lm_optim

def tokenize_function(batch):
  texts = [t if (t is not None and len(t.strip()) > 0) else tokenizer.eos_token for t in batch["text"]]
  tokenized = tokenizer(texts, padding=False, truncation=False)

  return {"input_ids": [list(ids) for ids in tokenized["input_ids"]]}

def chunk_for_explode(example):
  tokens = example['input_ids']

  if not isinstance(tokens, list):
    tokens = tokens.tolist()

  chunks_input = []
  chunks_label = []

  for i in range(0, len(tokens) - MAX_SEQ_LEN, MAX_SEQ_LEN):
    inp = tokens[i : i + MAX_SEQ_LEN]
    lab = tokens[i + 1 : i + MAX_SEQ_LEN + 1]

    chunks_input.append(inp)
    chunks_label.append(lab)

  return {"input_ids": chunks_input, "labels": chunks_label}

tokenized_data = dataset.map(
    tokenize_function,
    batched=True,
    remove_columns=dataset["train"].column_names,
    desc='Tokenizing'
)

chunked = tokenized_data.map(
    chunk_for_explode,
    batched=False,
    desc='Chunking data into sequences'
)

from datasets import Dataset, DatasetDict

processed_splits = {}

for split_name, ds in chunked.items():
    all_inputs = []
    all_labels = []

    for example in ds:
        for inp, lab in zip(example['input_ids'], example['labels']):
            if len(inp) == MAX_SEQ_LEN and len(lab) == MAX_SEQ_LEN:
                all_inputs.append(inp)
                all_labels.append(lab)

    processed_ds = Dataset.from_dict({
        "input_ids": all_inputs,
        "labels": all_labels
    })
    processed_ds.set_format(type="torch", columns=["input_ids", "labels"])
    processed_splits[split_name] = processed_ds

chunked = DatasetDict(processed_splits)

from torch.utils.data import DataLoader
from tqdm import tqdm
import os

NUM_WORKERS = os.cpu_count() // 2 or 1

train_loader = DataLoader(
    chunked["train"],
    batch_size=BATCH_SIZE,
    shuffle=True,
    drop_last=True,
    num_workers=NUM_WORKERS, # <--- Use multiple CPU cores
    pin_memory=True
)

DEVICE = "cuda" if torch.cuda.is_available() else "cpu"

DEVICE = torch.device("cuda" if torch.cuda.is_available() else "cpu")
Model = Model.to(DEVICE)
Model.train()

for epoch in range(NUM_EPOCHS):
    total_lm, total_rl, total_lb = 0, 0, 0
    pbar = tqdm(train_loader, desc=f"Epoch {epoch+1}/{NUM_EPOCHS}")

    for batch in pbar:
        input_ids = batch["input_ids"].to(DEVICE)
        labels    = batch["labels"].to(DEVICE)

        # Clamp to avoid embedding errors
        input_ids = torch.clamp(input_ids, 0, VOCAB_SIZ - 1)
        labels    = torch.clamp(labels, 0, VOCAB_SIZ - 1)

        lm_loss, rl_loss, lb_loss = Hybrid_training(
            Model,
            (input_ids, labels),
            rl_optim,
            lm_optim,
            LB_LOSS_WEIGHT
        )

        total_lm += lm_loss
        total_rl += rl_loss
        total_lb += lb_loss

        pbar.set_postfix({
            "LM": f"{lm_loss:.4f}",
            "RL": f"{rl_loss:.4f}",
            "LB": f"{lb_loss:.5f}"
        })

    print(f"Epoch {epoch+1} Summary | LM: {total_lm/len(train_loader):.4f}, RL: {total_rl/len(train_loader):.4f}, LB: {total_lb/len(train_loader):.5f}")

print(input_ids.max())  # should be < VOCAB_SIZ
